import React, { useEffect, useState } from "react";

const Images = () => {
  const [images, setImages] = useState([]);
  const [loading, setLoading] = useState(true);
  const [selectedImage, setSelectedImage] = useState(null);
  const [imageQuestions, setImageQuestions] = useState([]);
  const [loadingQuestions, setLoadingQuestions] = useState(false);

  useEffect(() => {
    fetchImages();
  }, []);

  const fetchImages = async () => {
    try {
      const res = await fetch("http://localhost:8000/images/");
      if (!res.ok) throw new Error("Failed to fetch images");
      const data = await res.json();
      setImages(data);
    } catch (err) {
      console.error(err);
    } finally {
      setLoading(false);
    }
  };

  const fetchImageQuestions = async (imageId) => {
    setLoadingQuestions(true);
    try {
      const res = await fetch(`http://localhost:8000/images/${imageId}/questions/`);
      if (!res.ok) throw new Error("Failed to fetch questions");
      const data = await res.json();
      setImageQuestions(data);
    } catch (err) {
      console.error(err);
      setImageQuestions([]);
    } finally {
      setLoadingQuestions(false);
    }
  };

  const handleImageClick = (image) => {
    setSelectedImage(image);
    fetchImageQuestions(image.image_id);
  };

  const closeModal = () => {
    setSelectedImage(null);
    setImageQuestions([]);
  };

  if (loading) {
    return (
      <div style={{
        display: "flex",
        flexDirection: "column",
        alignItems: "center",
        justifyContent: "center",
        minHeight: "60vh",
        gap: "1rem"
      }}>
        <div className="loader"></div>
        <p style={{ color: "#6b7280", fontSize: "1.1rem" }}>Loading your gallery...</p>
      </div>
    );
  }

  if (images.length === 0) {
    return (
      <div style={{
        textAlign: "center",
        padding: "4rem 2rem",
        backgroundColor: "white",
        borderRadius: "16px",
        maxWidth: "600px",
        margin: "2rem auto",
        boxShadow: "0 10px 15px -3px rgba(0, 0, 0, 0.1)"
      }}>
        <div style={{ fontSize: "4rem", marginBottom: "1rem" }}>üñºÔ∏è</div>
        <h2 style={{ color: "#1f2937", marginBottom: "0.5rem" }}>No images yet</h2>
        <p style={{ color: "#6b7280", marginBottom: "1.5rem" }}>
          Start by uploading an image and asking questions!
        </p>
        <a
          href="/vqa"
          style={{
            display: "inline-block",
            padding: "0.75rem 1.5rem",
            backgroundColor: "#6366f1",
            color: "white",
            textDecoration: "none",
            borderRadius: "8px",
            fontWeight: "600",
            transition: "all 0.3s ease"
          }}
          onMouseOver={(e) => e.target.style.transform = "translateY(-2px)"}
          onMouseOut={(e) => e.target.style.transform = "translateY(0)"}
        >
          Get Started
        </a>
      </div>
    );
  }

  return (
    <>
      <div style={{
        maxWidth: "1400px",
        margin: "0 auto",
        padding: "2rem"
      }}>
        <div style={{
          textAlign: "center",
          marginBottom: "2rem"
        }}>
          <h1 style={{ fontSize: "2.5rem", marginBottom: "0.5rem" }}>
            üì∏ Image Gallery
          </h1>
          <p style={{ color: "#6b7280", fontSize: "1.1rem" }}>
            {images.length} image{images.length !== 1 ? 's' : ''} with AI insights
          </p>
        </div>

        <div className="images-container">
          {images.map((img) => (
            <div
              key={img.image_id}
              className="image-card"
              onClick={() => handleImageClick(img)}
            >
              {img.image_data ? (
                <img src={img.image_data} alt={img.filename} />
              ) : (
                <div style={{
                  width: "100%",
                  height: "180px",
                  backgroundColor: "#f3f4f6",
                  display: "flex",
                  alignItems: "center",
                  justifyContent: "center",
                  borderRadius: "6px",
                  marginBottom: "0.75rem"
                }}>
                  <span style={{ color: "#9ca3af" }}>Image not available</span>
                </div>
              )}
              <div className="image-info">
                <strong>{img.filename}</strong>
                <p style={{
                  display: "flex",
                  alignItems: "center",
                  justifyContent: "center",
                  gap: "0.5rem",
                  color: "#6366f1",
                  fontWeight: "600"
                }}>
                  <span>üí¨</span> {img.questions_count} question{img.questions_count !== 1 ? 's' : ''}
                </p>
              </div>
            </div>
          ))}
        </div>
      </div>

      {/* Modal for Image Details */}
      {selectedImage && (
        <div
          style={{
            position: "fixed",
            top: 0,
            left: 0,
            right: 0,
            bottom: 0,
            backgroundColor: "rgba(0, 0, 0, 0.75)",
            display: "flex",
            alignItems: "center",
            justifyContent: "center",
            zIndex: 9999,
            padding: "1rem",
            animation: "fadeIn 0.3s ease"
          }}
          onClick={closeModal}
        >
          <div
            style={{
              backgroundColor: "white",
              borderRadius: "16px",
              maxWidth: "900px",
              width: "100%",
              maxHeight: "90vh",
              overflow: "auto",
              position: "relative",
              animation: "fadeInUp 0.4s ease"
            }}
            onClick={(e) => e.stopPropagation()}
          >
            {/* Close Button */}
            <button
              onClick={closeModal}
              style={{
                position: "sticky",
                top: "1rem",
                right: "1rem",
                float: "right",
                background: "white",
                border: "none",
                width: "40px",
                height: "40px",
                borderRadius: "50%",
                cursor: "pointer",
                display: "flex",
                alignItems: "center",
                justifyContent: "center",
                fontSize: "1.5rem",
                color: "#6b7280",
                boxShadow: "0 2px 8px rgba(0,0,0,0.1)",
                zIndex: 10
              }}
            >
              √ó
            </button>

            <div style={{ padding: "2rem" }}>
              {/* Image */}
              <div style={{ textAlign: "center", marginBottom: "2rem" }}>
                {selectedImage.image_data && (
                  <img
                    src={selectedImage.image_data}
                    alt={selectedImage.filename}
                    style={{
                      maxWidth: "100%",
                      maxHeight: "400px",
                      borderRadius: "12px",
                      boxShadow: "0 4px 6px -1px rgba(0, 0, 0, 0.1)"
                    }}
                  />
                )}
                <h2 style={{ marginTop: "1rem", color: "#1f2937" }}>
                  {selectedImage.filename}
                </h2>
              </div>

              {/* Questions & Answers */}
              <div>
                <h3 style={{
                  fontSize: "1.5rem",
                  color: "#1f2937",
                  marginBottom: "1rem",
                  display: "flex",
                  alignItems: "center",
                  gap: "0.5rem"
                }}>
                  üí¨ Questions & Answers
                </h3>

                {loadingQuestions ? (
                  <div style={{ textAlign: "center", padding: "2rem" }}>
                    <div className="loader" style={{ margin: "0 auto" }}></div>
                  </div>
                ) : imageQuestions.length > 0 ? (
                  <div style={{ display: "flex", flexDirection: "column", gap: "1rem" }}>
                    {imageQuestions.map((qa, index) => (
                      <div
                        key={qa.question_id}
                        style={{
                          padding: "1.25rem",
                          backgroundColor: "#f9fafb",
                          borderRadius: "12px",
                          borderLeft: "4px solid #6366f1"
                        }}
                      >
                        <div style={{
                          fontWeight: "600",
                          color: "#1f2937",
                          marginBottom: "0.5rem",
                          display: "flex",
                          alignItems: "start",
                          gap: "0.5rem"
                        }}>
                          <span style={{ color: "#6366f1" }}>Q{index + 1}:</span>
                          {qa.question}
                        </div>
                        <div style={{
                          color: "#6b7280",
                          paddingLeft: "1.75rem",
                          lineHeight: "1.6"
                        }}>
                          <strong style={{ color: "#10b981" }}>A:</strong> {qa.answer || "No answer yet"}
                        </div>
                      </div>
                    ))}
                  </div>
                ) : (
                  <div style={{
                    textAlign: "center",
                    padding: "2rem",
                    color: "#6b7280",
                    backgroundColor: "#f9fafb",
                    borderRadius: "12px"
                  }}>
                    No questions asked yet for this image
                  </div>
                )}
              </div>
            </div>
          </div>
        </div>
      )}
    </>
  );
};

export default Images;
